import React from 'react'

/**
 * Represents a cell within the application table.
 * @returns {JSX.Element}
 * @constructor
 */
const ApplicationTableCell = (props) => {
    return (
        <tr>
            <td>{props.business_name}</td>
            <td>{props.business_description}</td>
            <td>{props.role_type}</td>
            <td>{props.status}</td>
            <td>04 January 2021</td>
            <td>Options go here</td>
        </tr>
    )
}

export default ApplicationTableCell
